import { useState } from "react";


const Input = () => {
    const [inputText, setInputText] = useState("");

    function inputHandler(e){
        setInputText(e.target.value);
    }

    return(<>
        <input type="text" onChange={inputHandler} value={inputText}/>;
        
       </>
       );
}

export default Input;
